import s from './Dialogs.module.css'
import Messages from './Messages/Messages'
import Dialog from "./Dialog/Dialog";
const Dialogs = (props) => {
    return(
        <div className={s.dialogs}>
            <div className={s.dialogsItem}>
                <Dialog num={'1'}/>
                <Dialog num={'2'}/>
                <Dialog num={'3'}/>
            </div>
            <Messages/>
        </div>
    );
}

export default Dialogs;
